import React from 'react';

const SideLinks = ({name, Icon}) => {
    return (
        <li>
            <a href="#">
                <div className='inline-block'>
                    <div className='flex items-center hover:bg-dark-frame hover:text-blue-200
                      rounded-full pl-3 pr-8 py-3'>
                        <Icon/>
                    </div>
                    <span>{name}</span>
                </div>
            </a>
        </li>
    );
};

export default SideLinks;
